import React from "react";

const Navbar =()=>{
return(
  <div className="parent">

    <div className="child-1">
    <h1>TechShed</h1>
    <button> Get 15% off your first purchase </button>
  </div>


  <div className="child-2">
      <ul>
      <li>Home</li>
      <li>Products</li>
      <li>Cards</li>
      <li>Contact</li>
      </ul>
  
      <button>Log in</button>
  </div>
</div>
);
}
export default Navbar;
